import React, {useState} from "react";
import { Container } from "@mui/material";
import TabsComponent from "../../components/Tabs";
import Frontend from "../../components/Frontend";
import Backend from "../../components/Backend";
import Ios from "../../components/Ios";
import Android from "../../components/Android";
import UxUi from "../../components/UxUi";
import {SwiperComponent} from "../../components/Swiper";

const VALUES = {
    Frontend: 'Frontend',
    Backend: 'Backend',
    ios: 'ios',
    Android: 'Android',
    UxUi: 'Ux/Ui',
}

const GetCategories = ({ tab }) => {
    switch (tab) {
        case VALUES.Frontend: {
            return <Frontend/>
        }
        case VALUES.Backend: {
            return <Backend/>
        }
        case VALUES.ios: {
            return <Ios/>
        }
        case VALUES.Android: {
            return <Android/>
        }
        case VALUES.UxUi: {
            return <UxUi/>
        }
        default: return <></>
    }
}

const Main = () => {

    const categoriesSelect = [
        { value: VALUES.Frontend, label: 'Frontend'},
        { value: VALUES.Backend, label: 'Backend'},
        { value: VALUES.ios, label: 'Ios'},
        { value: VALUES.Android, label: 'Android'},
        { value: VALUES.UxUi, label: 'Ux/Ui'}
    ]

    const [value, setValue] = useState(categoriesSelect?.[0].value)

    const swiperImages = [
        { url:'https://nt.ua/Media/Default/img/profession-frontenf-dev_ru.png'},
        { url:'data:image/png;base64,'},
        { url:'data:image/jpeg;base64,'},
        { url:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSn7zl5CrfFE0TyQ9EBuvIMH6XXbaQyM0-dSQ&s'},
        { url:'data:image/jpeg;base64,'}
    ]

    return (
        <Container>
            <TabsComponent categoriesSelect={categoriesSelect} value={value} setValue={setValue} />
            <GetCategories tab={value}/>
            <SwiperComponent swiperImage={swiperImages}/>
        </Container>
    )
}


export default Main;